/* Specific rules for the notebook merge conflict */
.jp-git-diff-root .jp-Notebook-merge .jp-Merge-conflict,
.jp-git-diff-root .jp-Notebook-merge .CodeMirror-merge-l-chunk,
.jp-git-diff-root
  .jp-Notebook-merge
  .CodeMirror-merge-l-chunk.CodeMirror-merge-r-chunk,
.jp-git-diff-root
  .jp-Notebook-merge
  .jp-Cellrow-outputs.jp-conflicted-outputs
  .jp-CollapsiblePanel-header {
  background-color: var(--jp-git-diff-deleted-color);
}

.jp-git-diff-root
  .jp-Notebook-merge
  .CodeMirror-line
  .CodeMirror-merge-r-inserted {
  background-color: var(--jp-git-diff-deleted-color);
}

.jp-git-diff-root
  .jp-Notebook-merge
  .CodeMirror-merge-pane-base
  .CodeMirror-line
  .CodeMirror-merge-m-deleted,
.jp-git-diff-root
  .jp-Notebook-merge
  .CodeMirror-merge-pane-base
  .CodeMirror-line
  .CodeMirror-merge-l-deleted,
.jp-git-diff-root
  .jp-Notebook-merge
  .CodeMirror-merge-pane-base
  .CodeMirror-line
  .CodeMirror-merge-r-deleted {
  background-color: var(--jp-git-diff-deleted-color);
  color: var(--jp-mirror-editor-string-color);
}

.jp-git-diff-root
  .jp-Notebook-merge
  .CodeMirror-merge-pane-base
  .CodeMirror-line
  .CodeMirror-merge-m-added,
.jp-git-diff-root
  .jp-Notebook-merge
  .CodeMirror-merge-pane-base
  .CodeMirror-line
  .CodeMirror-merge-l-added,
.jp-git-diff-root
  .jp-Notebook-merge
  .CodeMirror-merge-pane-base
  .CodeMirror-line
  .CodeMirror-merge-r-added {
  background-color: var(--jp-git-diff-added-color);
  color: var(--jp-mirror-editor-string-color);
}

/* Hide drag handles */
.jp-git-diff-root .jp-Notebook-merge .jp-DragPanel-dragHandle {
  display: none;
}

.jp-git-diff-parent-widget .jp-Merge-notebook-controls {
	margin-bottom: 0px;
	padding: 0px;
	background-color: transparent;
	border: none;
}

/* Hiding unchanged cells if told to */
.jp-git-diff-root .nbdime-root.jp-mod-hideUnchanged .jp-Cell-merge.jp-Merge-unchanged {
  display: none;
}

/* Show a marker with the number of cells hidden before */
.jp-git-diff-root .nbdime-root.jp-mod-hideUnchanged .jp-Cell-merge[data-nbdime-NCellsHiddenBefore]::before {
  content: attr(data-nbdime-NCellsHiddenBefore) " unchanged cell(s) hidden";
  position: absolute;
  width: 100%;
  top: 0;
  background-color: #eee;
  border-top: solid #ccc 1px;
  border-bottom: solid #ccc 1px;
  text-align: center;
}

/* Show a marker with the number of cells hidden after (for hidden cells at end) */
.jp-git-diff-root .nbdime-root.jp-mod-hideUnchanged .jp-Cell-merge[data-nbdime-NCellsHiddenAfter]::after {
  content: attr(data-nbdime-NCellsHiddenAfter) " unchanged cell(s) hidden";
  position: absolute;
  width: 100%;
  bottom: 0;
  background-color: #eee;
  border-top: solid #ccc 1px;
  border-bottom: solid #ccc 1px;
  text-align: center;
}

.jp-git-diff-root .nbdime-root.jp-mod-hideUnchanged .jp-Cell-merge[data-nbdime-NCellsHiddenBefore] {
  padding-top: 40px;
}

.jp-git-diff-root .nbdime-root.jp-mod-hideUnchanged .jp-Cell-merge[data-nbdime-NCellsHiddenAfter] {
  padding-bottom: 40px;
}

/* Marker for when all cells are unchanged and hidden */
.jp-git-diff-root .nbdime-root.jp-mod-hideUnchanged .jp-Notebook-merge[data-nbdime-AllCellsHidden]::after {
  content: "No changes, " attr(data-nbdime-AllCellsHidden) " unchanged cell(s) hidden";
  display: block;
  width: 100%;
  background-color: #eee;
  border-top: solid #ccc 1px;
  border-bottom: solid #ccc 1px;
  text-align: center;
}

.jp-git-PlainText-diff {
  width: 100%;
  max-height: calc(100% - 23px);
}

.jp-git-PlainText-diff .CodeMirror-merge,
.jp-git-PlainText-diff .CodeMirror-merge .CodeMirror,
.jp-git-PlainText-diff .CodeMirror-merge .CodeMirror-merge-pane {
  height: 100%;
}

.jp-git-PlainText-diff .CodeMirror-merge-gap {
  z-index: 2;
  display: inline-block;
  height: 100%;
  -moz-box-sizing: border-box;
  box-sizing: border-box;
  overflow: hidden;
  border-left: var(--codemirror-border);
  border-right: var(--codemirror-border);
  position: relative;
  color: var(--jp-ui-font-color2);
  background: var(--jp-layout-color2);
}

.jp-git-PlainText-diff .CodeMirror-merge-r-inserted,
.jp-git-PlainText-diff .CodeMirror-merge-l-inserted {
  background-position: bottom left;
  background-repeat: repeat-x;
}

.jp-git-PlainText-diff .CodeMirror-merge-r-deleted,
.jp-git-PlainText-diff .CodeMirror-merge-l-deleted {
  background-position: bottom left;
  background-repeat: repeat-x;
}

.jp-git-PlainText-diff .CodeMirror-merge-left .CodeMirror-merge-l-chunk,
.jp-git-PlainText-diff .CodeMirror-merge-right .CodeMirror-merge-r-chunk {
  background-color: var(--jp-git-diff-deleted-color);
}

.jp-git-PlainText-diff .CodeMirror-merge-l-chunk,
.jp-git-PlainText-diff .CodeMirror-merge-editor .CodeMirror-merge-l-chunk,
.jp-git-PlainText-diff .CodeMirror-merge-editor .CodeMirror-merge-r-chunk {
  background-color: var(--jp-git-diff-added-color);
}

.CodeMirror-patchgutter {
  width: 0.7em;
}

.CodeMirror-patchgutter-insert::before {
  content: '+';
  color: #999;
  background-color: var(--jp-git-diff-added-color);
}

.CodeMirror-patchgutter-delete::before {
  content: '-';
  color: #999;
  background-color: var(--jp-git-diff-deleted-color);
}

/* Styles for horizontal scroll lock */
.jp-git-PlainText-diff .CodeMirror-merge-scrolllock {
  color: var(--jp--inverse-layout-color2);
}
.jp-git-PlainText-diff .CodeMirror-merge-scrolllock:after {
  content: '\21db\00a0\00a0\21da';
}
.jp-git-PlainText-diff
  .CodeMirror-merge-scrolllock.CodeMirror-merge-scrolllock-enabled:after {
  content: '\21db\21da';
}

/* Styles for revert buttons handling */

.jp-git-PlainText-diff .CodeMirror-merge-copybuttons-left,
.jp-git-PlainText-diff .CodeMirror-merge-copybuttons-right {
  position: absolute;
  left: 0;
  top: 0;
  right: 0;
  bottom: 0;
  line-height: 1;
}

.jp-git-PlainText-diff .CodeMirror-merge-copy {
  position: absolute;
  cursor: pointer;
  color: var(--jp-brand-color1);
  z-index: 3;
}

.jp-git-PlainText-diff .CodeMirror-merge-copy-reverse {
  position: absolute;
  cursor: pointer;
  color: var(--jp-brand-color1);
}

.jp-git-PlainText-diff
  .CodeMirror-merge-copybuttons-left
  .CodeMirror-merge-copy {
  left: 2px;
}
.jp-git-PlainText-diff
  .CodeMirror-merge-copybuttons-right
  .CodeMirror-merge-copy {
  right: 2px;
}

